Fürst (ĉeĥe: kníže) (Germanlingva prononco: [ˈfʏʁst], ina formo Fürstin, plurale Fürsten; el malnovaltgermana lingvo furisto, "la unua", traduko de la Latina princeps) estas Germana vorto por reganto kaj estas ankaŭ princlanda titolo, tio estas princo. Fürsten estis, ekde la Mezepoko, membroj de la plej alta nobelaro kiu regis super ŝtatoj de la Sankta Romia Imperio kaj poste de ties iamaj teritorioj, sub la reganta Kaiser (imperiestro) aŭ König (reĝo). La Princo de la Sankta Romia Imperio estis la reĝanta suverena reganto de Imperia stato kiu tenis Imperian senperecon ene de la limoj de la Sankta Romia Imperio. La teritorio regata estas referencata en Germana lingvo kiel Fürstentum (princlando), la familia dinastio referencata kiel Fürstenhaus (princlanda domo), kaj la (ne-regantaj) posteuloj de Fürst estas titolitaj kaj referencataj en Germana kiel Prinz (princo) aŭ Prinzessin (princino). Ĝermanaj (angla, germana, nederlanda) kaj Slavaj lingvoj (rusa, pola, ukraina, serba, kroata, ktp.) uzas diferencajn terminojn por princo kaj Fürst. Dume Latinidaj lingvoj (franca, itala, rumana, hispana, portugala) uzas nur unusolan terminon por ambaŭ konceptoj. Ekde la Mezepoko, la Germana nomumo kaj titolo Fürst referencas al: 
* la plej altaj membroj de la nobelaro kiu regis super la Sankta Romia Imperio, sub la reganta Kaiser (imperiestro) aŭ König (reĝo); 
* membroj de la nobelaro sur la rango de Graf (grafo) sed sub Herzog (Duko); 
* reganto aŭ monarko (ĝenerale).

Fürst (German pronunciation: [ˈfʏʁst], female form Fürstin, plural Fürsten; from Old High German furisto, "the first", a translation of the Latin princeps) is a German word for a ruler and is also a princely title. Fürsten were, since the Middle Ages, members of the highest nobility who ruled over states of the Holy Roman Empire and later its former territories, below the ruling Kaiser (emperor) or König (king). A Prince of the Holy Roman Empire was the reigning sovereign ruler of an Imperial State that held imperial immediacy in the boundaries of the Holy Roman Empire. The territory ruled is referred to in German as a Fürstentum (principality), the family dynasty referred to as a Fürstenhaus (princely house), and the (non-reigning) descendants of a Fürst are titled and referred to in German as Prinz (prince) or Prinzessin (princess). The English language uses the term "prince" for both concepts. Latin-based languages (French, Italian, Romanian, Spanish, Portuguese) also employ a single term, whereas Dutch as well as the Scandinavian and some Slavic languages use separate terms similar to those used in German (see knyaz for the latter). An East Asian parallel to the concept of "ruling prince" would be the Sino-Xenic word 王 (pronounced wáng in Mandarin, wong4 in Cantonese, ō in Japanese, wang in Korean and vương in Vietnamese), which commonly refers to Korean and non-East-Asian "kings", but usually refers to non-imperial monarchs (who would go by 皇帝 ("emperor" or "empress regnant") instead) in ancient China and Vietnam and therefore is frequently translated to "prince", especially for those who became rulers well after to the first adoption of the title 皇帝 by Qin Shi Huang. Some examples include China's Prince Wucheng and Vietnam's Prince Hưng Đạo. On the other hand, the son of a monarch would go by different titles, such as 皇子 ("imperial son"), 親王 ("prince of the blood") or 王子 ("royal son"). A "European sovereign prince" may have the same title as a "duke", namely 公, and "principality" is translated to the same word as "duchy", namely 公国. Since the Middle Ages, the German designation and title of Fürst refers to: 
* rulers of the states that made up the Holy Roman Empire, below the ruling Kaiser (Emperor) or König (King); 
* members of the nobility above the rank of Graf (Count) but below Herzog (Duke); 
* a ruler or monarch (in general).
